import React, { useContext } from "react";
import UserService from "./../00-Context/UserService";
import axios from "axios";
import TableRow from "./TableRow/TableRow";

const Cart = () => {
  const userService = useContext(UserService);

  var products = [];
  var tableRows = [];

  if (userService.username.length > 0) {
    let urlBuilder =
      "https://itpro2017.herokuapp.com/api/users/" +
      userService.username +
      "/cart-products";
    axios
      .get(urlBuilder)
      .then(response => {
        products = response.data;
        tableRows = tableRows = products.map(item => {
          return (
            <TableRow id={item.id} image={item.image} title={item.title} />
          );
        });
      })
      .catch(error => {
        console.log(error);
      });
  }

  return <h1>{userService.username}</h1>;
};

export default Cart;
